import React, { useState } from 'react';
import styled from 'styled-components';
import RightNavBixo from './RightNavBixo';

const StyledBurgerBixo = styled.div<{open: boolean}>`
  width: 3rem;
  height: 3rem;
  position: fixed;
  top: 8vw;
  right: 4vw;
  z-index: 101;
  transform: ${({ open }) => open ? 'rotate(-90deg)' : 'translateX(0)' };
  transition: all 0.25s linear;
  background-color: ${({ open }) => open ? '#e7a72f' : '#e7a72f'};
  border-radius: 1.1rem;
  div {
    width: 2rem;
    height: 0.25rem;
    margin: 0.525rem;
    background-color: ${({ open }) => open ? '#ccc' : '#ccc'};
    border-radius: 10px;
    
  }
`;

const BurgerBixo = () => {
  const [open, setOpen] = useState(false)
  
  return (
    <>
    
      <StyledBurgerBixo open={open} onClick={() => setOpen(!open)}>
        <div />
        <div />
        <div />
      </StyledBurgerBixo>
      <RightNavBixo open={open}/>
    </>
  )
}

export default BurgerBixo
